define("ckeditor/_source/plugins/a11yhelp/lang/tr",["dijit","dojo","dojox"],function(){CKEDITOR.plugins.setLang("a11yhelp","tr",{accessibilityHelp:{title:"Eri\u015filebilirlik Talimatlar\u0131",contents:"Yard\u0131m i\u00e7eri\u011fi. Bu pencereyi kapatmak i\u00e7in ESC tu\u015funa bas\u0131n.",legend:[{name:"Genel",items:[{name:"Ara\u00e7 \u00c7ubu\u011fu Edit\u00f6r\u00fc",legend:"Ara\u00e7 \u00e7ubu\u011funda gezinmek i\u00e7in ${toolbarFocus} bas\u0131n. TAB ve SHIFT-TAB ile \u00f6nceki ve sonraki ara\u00e7 \u00e7ubu\u011fu grubuna ta\u015f\u0131y\u0131n. SA\u011e OK veya SOL OK ile \u00f6nceki ve sonraki bir ara\u00e7 \u00e7ubu\u011fu d\u00fc\u011fmesini hareket ettirin. SPACE tu\u015funa bas\u0131n veya ara\u00e7 \u00e7ubu\u011fu d\u00fc\u011fmesini etkinle\u015ftirmek i\u00e7in ENTER tu\u015fna bas\u0131n."},
{name:"Dialog Edit\u00f6r\u00fc",legend:"Dialog penceresi i\u00e7inde, sonraki ileti\u015fim alan\u0131na gitmek i\u00e7in SEKME tu\u015funa bas\u0131n, \u00f6nceki alana ge\u00e7mek i\u00e7in SHIFT + TAB tu\u015funa bas\u0131n, pencereyi g\u00f6ndermek i\u00e7in ENTER tu\u015funa bas\u0131n, dialog penceresini iptal etmek i\u00e7in ESC tu\u015funa bas\u0131n. Birden \u00e7ok sekme sayfalar\u0131 olan diyaloglar\u0131n, sekme listesine gitmek i\u00e7in ALT + F10 tu\u015flar\u0131na bas\u0131n. Sonra TAB veya SA\u011e OK sonraki sekmeye ta\u015f\u0131y\u0131n. SHIFT + TAB veya SOL OK ile \u00f6nceki sekmeye ge\u00e7in. Sekme sayfay\u0131 se\u00e7mek i\u00e7in SPACE veya ENTER tu\u015funa bas\u0131n."},
{name:"\u0130\u00e7erik Men\u00fc Edit\u00f6r\u00fc",legend:"\u0130\u00e7erik men\u00fcs\u00fcn\u00fc a\u00e7mak i\u00e7in ${contextMenu} veya UYGULAMA TU\u015eU'na bas\u0131n. Daha sonra SEKME veya A\u015eA\u011eI OK ile bir sonraki men\u00fc se\u00e7ene\u011fi ta\u015f\u0131y\u0131n. SHIFT + TAB veya YUKARI OK ile \u00f6nceki se\u00e7ene\u011fe gider. Men\u00fc se\u00e7ene\u011fini se\u00e7mek i\u00e7in SPACE veya ENTER tu\u015funa bas\u0131n. Se\u00e7ili se\u00e7ene\u011fin alt men\u00fcs\u00fcn\u00fc SPACE ya da ENTER veya SA\u011e OK a\u00e7\u0131n. \u00dcst men\u00fc \u00f6\u011fesini ge\u00e7mek i\u00e7in ESC veya SOL OK ile geri d\u00f6n\u00fcn. ESC ile ba\u011flam men\u00fcs\u00fcn\u00fc kapat\u0131n."},
{name:"Liste Kutusu Edit\u00f6r\u00fc",legend:"Liste kutusu i\u00e7inde, bir sonraki liste \u00f6\u011fesine SEKME VEYA A\u015eA\u011eI OK ile ta\u015f\u0131y\u0131n. SHIFT + TAB veya YUKARI \u00f6nceki liste \u00f6\u011fesi ta\u015f\u0131y\u0131n. Liste se\u00e7ene\u011fi se\u00e7mek i\u00e7in SPACE veya ENTER tu\u015funa bas\u0131n. Liste kutusunu kapatmak i\u00e7in ESC tu\u015funa bas\u0131n."},{name:"Element Yol \u00c7ubu\u011fu Edit\u00f6r\u00fc",legend:"Elementlerin yol \u00e7ubu\u011funda gezinmek i\u00e7in ${ElementsPathFocus} bas\u0131n. SEKME veya SA\u011e OK ile sonraki element d\u00fc\u011fmesine ta\u015f\u0131y\u0131n. SHIFT + TAB veya SOL OK \u00f6nceki d\u00fc\u011fmeye hareket ettirin. Edit\u00f6r i\u00e7indeki elementi se\u00e7mek i\u00e7in ENTER veya SPACE tu\u015funa bas\u0131n."}]},
{name:"Komutlar",items:[{name:"Komutu geri al",legend:"${undo} bas\u0131n"},{name:" Tekrar komutu uygula",legend:"${redo} bas\u0131n"},{name:" Kal\u0131n komut",legend:"${bold} bas\u0131n"},{name:" \u0130talik komutu",legend:"${italic} bas\u0131n"},{name:" Alttan \u00e7izgi komutu",legend:"${underline} bas\u0131n"},{name:" Ba\u011flant\u0131 komutu",legend:"${link} bas\u0131n"},{name:" Ara\u00e7 \u00e7ubu\u011fu Toplama komutu",legend:"${toolbarCollapse} bas\u0131n"},{name:"Eri\u015filebilirlik Yard\u0131m\u0131",
legend:"${a11yHelp} bas\u0131n"}]}]}})});